import React, { useState } from 'react';
import { motion } from 'framer-motion';

function Contact() {
    return (
        <div id='Contact'>
            <img id='left-hand' src='../img/left-hand.png' alt='left hand' />
            <img id='right-hand' src='../img/right-hand.png' alt='right hand' />

        </div>
    );
}

export default Contact;
